campaignTrail_temp.questions_json = JSON.parse("[{\"model\": \"campaign_trail.question\", \"pk\": 393, \"fields\": {\"priority\": 0, \"description\": \"Today you have announced the selection of Dick Cheney as running mate. Can you speak more about him?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 366, \"fields\": {\"priority\": 1, \"description\": \"What key points will you emphasize as you accept your party's nomination for President of the United States?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 369, \"fields\": {\"priority\": 1, \"description\": \"What is your overall strategy for the 2000 campaign?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 350, \"fields\": {\"priority\": 2, \"description\": \"Do you have any plans to change American tax policy?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 343, \"fields\": {\"priority\": 2, \"description\": \"Which of the following best describes your position on the $200 billion surplus that is projected for this year?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 348, \"fields\": {\"priority\": 2, \"description\": \"Do you believe that Elian Gonzalez should have been returned to Cuba?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 347, \"fields\": {\"priority\": 2, \"description\": \"Do you have any thoughts on the Bill Clinton scandal that you would like to share?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 344, \"fields\": {\"priority\": 2, \"description\": \"Which of the following best describes your position on education?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 345, \"fields\": {\"priority\": 2, \"description\": \"Which of the following best describes your position on Social Security?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 349, \"fields\": {\"priority\": 2, \"description\": \"Did you support Bill Clinton's actions leading to the bombing of Serbia?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 351, \"fields\": {\"priority\": 2, \"description\": \"What are your thoughts on the USS Cole bombing, which has killed 17 American sailors. How should we prevent such incidents of terrorism in the future?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 346, \"fields\": {\"priority\": 2, \"description\": \"What is your vision for the foreign policy of this country?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 388, \"fields\": {\"priority\": 3, \"description\": \"Do you have anything to say about your alleged drug use in the 1970s?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 374, \"fields\": {\"priority\": 3, \"description\": \"Another day, another rally on the campaign trail. What do you prefer to talk about today?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 362, \"fields\": {\"priority\": 3, \"description\": \"Do you support proposals to expand oil drilling in Alaska, and specifically in the Alaska National Wildlife Refuge?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 365, \"fields\": {\"priority\": 3, \"description\": \"What do you think of proposals to build a sophisticated missile defense system in Eastern Europe?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 359, \"fields\": {\"priority\": 3, \"description\": \"What is your position on abortion?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 358, \"fields\": {\"priority\": 3, \"description\": \"Do you have any plans to address or change immigration policy if elected President?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 372, \"fields\": {\"priority\": 3, \"description\": \"Another day, another rally on the campaign trail. What do you prefer to talk about today?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 355, \"fields\": {\"priority\": 3, \"description\": \"The Kyoto Protocol would commit the United States (along with many other countries) to reduce greenhouse gas emissions. Would you support this plan as President?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 364, \"fields\": {\"priority\": 3, \"description\": \"Do you think that new regulations from Bill Clinton have unfairly hurt coal-producing states?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 389, \"fields\": {\"priority\": 3, \"description\": \"Some suggest you lack the experience and qualifications for to be President. What do you say?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 352, \"fields\": {\"priority\": 3, \"description\": \"In Texas, a man named James Byrd was brutally murdered in what many call a hate crime. What is your opinion of federal hate crime legislation?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 384, \"fields\": {\"priority\": -2, \"description\": \"It is November 2nd, only five days before the voting. News has just broken that you were arrested for drunken driving in 1976. What is your response?\", \"likelihood\": 1.0}}, {\"model\": \"campaign_trail.question\", \"pk\": 381, \"fields\": {\"priority\": -1, \"description\": \"Where will you make the final stop(s) of your campaign before the voting begins?\", \"likelihood\": 1.0}}]");
campaignTrail_temp.answers_json = JSON.parse("[{\"model\": \"campaign_trail.answer\", \"pk\": 3312, \"fields\": {\"question\": 343, \"description\": \"We need to expand benefits for Social Security, Medicare, and Medicaid. We can use the surplus as well as defense cuts to balance these increases.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3345, \"fields\": {\"question\": 352, \"description\": \"I can certainly see the need for some legislation, but it should be addressed at the state level.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3310, \"fields\": {\"question\": 343, \"description\": \"We should enact tax cuts to return this money to the American people. My plan will reduce the burden for all Americans who currently pay income tax.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3311, \"fields\": {\"question\": 343, \"description\": \"We should try to keep things as they are. The economy has been unusually good the past few years, and we already have a large federal debt to pay down.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3313, \"fields\": {\"question\": 343, \"description\": \"I would prefer to see us allocate this money to new and existing government programs so that all Americans can share in our prosperity.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3314, \"fields\": {\"question\": 344, \"description\": \"I believe that we need to return control of education to the states and to the people. I would end the Department of Education as President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3315, \"fields\": {\"question\": 344, \"description\": \"Many schools are squandering the resources of the federal government. I support providing school vouchers directly to parents, so that they can choose where their child goes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3316, \"fields\": {\"question\": 344, \"description\": \"We need more spending for America's struggling schools, and national standards and testing to identify and fix poor performers. Every child deserves a strong, functional school to attend.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3317, \"fields\": {\"question\": 344, \"description\": \"We need to increase pay for teachers and increase funding for the Department of Education. I don't support nationwide standards or testing -- they will distort the learning process and lead to education by rote.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3318, \"fields\": {\"question\": 345, \"description\": \"The Social Security system is a financial time bomb. We need to get rid of it, or at the very least cut its benefits significantly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3319, \"fields\": {\"question\": 345, \"description\": \"The average worker would do much better if their money was invested in the stock market. I support a plan to allow workers to contribute at least some of their Social Security contribution to an individual investment account.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3320, \"fields\": {\"question\": 345, \"description\": \"I would establish an iron-clad lockbox for the Social Security fund. When we allow the federal government to borrow our Social Security money, we put every senior in this country at risk.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3321, \"fields\": {\"question\": 345, \"description\": \"We need to increase benefits for Social Security. Many people can barely survive on the monthly payment, while we spend billions on the military and run a huge budget surplus.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3322, \"fields\": {\"question\": 346, \"description\": \"The Cold War is over. We should cut defense spending and stop operating so many bases overseas. I would pull troops out of places like Germany and Okinawa, where we are no longer defending anything.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3323, \"fields\": {\"question\": 346, \"description\": \"America should remain tough, but humble. I am concerned about some of our recent interventions in places like Somalia and Serbia.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3324, \"fields\": {\"question\": 346, \"description\": \"We need to remain an engaged, committed defender of human rights in the world. We should do everything possible to secure the friendship of nations like Russia and China, and to prevent atrocities and genocide in the developing world.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3325, \"fields\": {\"question\": 346, \"description\": \"I would focus on removing dictators like Saddam Hussein and Kim Jong Il from power. They threaten the stability of the world and perpetrate evil upon their people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3326, \"fields\": {\"question\": 347, \"description\": \"Bill Clinton was an embarrassment to the United States, and his impeachment was well-deserved. I believe that he should have been removed from office.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3327, \"fields\": {\"question\": 347, \"description\": \"I don't think we need to belabor the point. I pledge to the American people that I will restore honor and dignity to the White House when I am President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3328, \"fields\": {\"question\": 347, \"description\": \"I am my own man. I respect Bill Clinton in many ways, but his personal conduct was lacking in this case.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3329, \"fields\": {\"question\": 347, \"description\": \"This is a non-issue. Bill Clinton is one the best Presidents of the last fifty years, and we should be focusing on his policies and successes, not his personal affairs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3330, \"fields\": {\"question\": 348, \"description\": \"Returning Elian to Cuba was unconscionable. I did not support this decision by the Clinton Administration.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3331, \"fields\": {\"question\": 348, \"description\": \"We should be talking less about Elian, and more about my plans to expand upon the great prosperity of this nation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3332, \"fields\": {\"question\": 348, \"description\": \"The law is the law. Elian belongs in Cuba with his father. These questions are never easy, but the Clinton Administration and Janet Reno did what they had to do.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3333, \"fields\": {\"question\": 349, \"description\": \"This was an issue that had no bearing on the security of the United States. We also ruined any chance of mediation by insisting on the autonomy of Kosovo.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3334, \"fields\": {\"question\": 349, \"description\": \"This certainly helped unseat Slobodan Milosevic, but as President I will make sure that America treads carefully before intervening in foreign nations' affairs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3335, \"fields\": {\"question\": 349, \"description\": \"I support our actions in this theatre. For minimal cost we were able to stop a potential genocide and put a dictator to justice.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3336, \"fields\": {\"question\": 349, \"description\": \"The bombing of Serbia killed many innocent civilians and increased antagonism with Russia and China. I believe military intervention should be a last resort.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3337, \"fields\": {\"question\": 350, \"description\": \"We need huge tax cuts across the board. Corporate, personal, and capital gains taxes should be slashed. This will further expand the economy through increases in investment.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3338, \"fields\": {\"question\": 350, \"description\": \"My budget will cut taxes and return a portion of our budget surplus to the American people. Everybody who pays taxes will receive a reduction.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3339, \"fields\": {\"question\": 350, \"description\": \"We have a plan for middle class tax cuts. But it would be irresponsible to make huge changes while we still have a large debt.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3340, \"fields\": {\"question\": 350, \"description\": \"I have no plan to cut taxes. If anything, we might need some increases to strengthen Social Security.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3341, \"fields\": {\"question\": 351, \"description\": \"I support a strong, overwhelming response against whoever perpetrated this attack. Any government that harbors such terrorists should be overthrown, even if it requires the commitment of American troops.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3342, \"fields\": {\"question\": 351, \"description\": \"We need to do two things -- first of all we need better procedures to ensure that our forces in dangerous regions do better at protecting themselves. Secondly, we will investigate who is responsible for this attack, be it Al-Qaeda or some other group, and attack them accordingly.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3343, \"fields\": {\"question\": 351, \"description\": \"This attack was a tragedy, but it underscores the need to the United States to have a more limited foreign policy. The Cold War is over, and it doesn't make sense to deploy troops in so many parts of the world.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3344, \"fields\": {\"question\": 352, \"description\": \"A crime is a crime, no matter what the motive is. I do not support ideas that some victims should be held in higher regard than others.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3346, \"fields\": {\"question\": 352, \"description\": \"I support increased federal hate crime legislation. No American should ever feel like a target of intimidation because of their identity.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3355, \"fields\": {\"question\": 355, \"description\": \"We have no proof that global warming exists, and we should be expanding our production of coal and oil to obtain energy independence. I would not surrender the sovereignty of our nation for such trivial objectives.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3356, \"fields\": {\"question\": 355, \"description\": \"I would not. The Protocol exempts 80% of the world, including major population centers such as China and India, from compliance, and would cause serious harm to the US economy.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3357, \"fields\": {\"question\": 355, \"description\": \"It seems very unlikely that the Senate will ever come up with the votes to ratify this agreement. I don't know how my support or opposition would change that equation.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3358, \"fields\": {\"question\": 355, \"description\": \"We have worked for years with many other countries to negotiate this agreement. I support the environment and believe the Protocol should be ratified.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3366, \"fields\": {\"question\": 358, \"description\": \"We have almost 9 million illegal immigrants in this country. I support stronger enforcement of immigration laws to reduce this number.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3367, \"fields\": {\"question\": 358, \"description\": \"All people contribute to a prosperous America. I support a combination of stronger immigration enforcement with a path to citizenship for people currently in the country. We can do better than we did with the 1986 law.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3368, \"fields\": {\"question\": 358, \"description\": \"I prefer to focus on making responsible use of our budget surplus and securing prosperity for the next generation of Americans.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3369, \"fields\": {\"question\": 358, \"description\": \"We need a path to citizenship for those in the country, and we need a system of work permits and strict enforcement on employers, so that immigrants do not depress American wages. We should increase aid to Latin America to reduce the rich-poor divide in our economies.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3370, \"fields\": {\"question\": 359, \"description\": \"Over a million unborn children are killed every year in this country. We need judges who will overturn <em>Roe v. Wade</em>, or we need a Constitutional Amendment to end the practice of abortion.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3371, \"fields\": {\"question\": 359, \"description\": \"I am a pro-life candidate for President, but I understand that we have certain legal protections in place. At the very least, we can end taxpayer funding for this practice.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3372, \"fields\": {\"question\": 359, \"description\": \"My goal as President will be to reduce abortions in this country to the lowest level possible. We can increase education and funding for contraception, to reduce unwanted pregnancies. I might be open to ending late-term abortions.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3373, \"fields\": {\"question\": 359, \"description\": \"I strongly support the right of a woman to choose. We need to defend this right, and we should increase funding for women's health services, unconditionally.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3381, \"fields\": {\"question\": 362, \"description\": \"Absolutely. Anything we can do to work towards energy independence in this country is a positive step. Oil and coal are the foundation of any energy policy, and should be exploited as much as possible.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3382, \"fields\": {\"question\": 362, \"description\": \"This is fine with me, but it is a small part of the overall solution. We need to drill wherever we can, while encouraging innovation in other sectors of the energy market.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3383, \"fields\": {\"question\": 362, \"description\": \"I oppose these plans. The ANWR is an environmental treasure of the United States, and the oil gained from any exploitation will be relatively limited.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3384, \"fields\": {\"question\": 362, \"description\": \"This is a giveaway to oil companies that will not resolve America's underlying energy issues. We need more government investment in renewable energy sources, and strict regulations on oil and coal.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3388, \"fields\": {\"question\": 364, \"description\": \"Absolutely. This is just another example of meddling that harms the economy, hurts energy production, and puts hard-working Americans out of work.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3389, \"fields\": {\"question\": 364, \"description\": \"Unfortunately, coal is one of the dirtiest forms of energy in existence. I don't see how we can continue to rely on it for the majority of America's energy needs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3390, \"fields\": {\"question\": 365, \"description\": \"This is a necessary step to protect our allies in Europe from current and future threats to their security. I will strongly support this as President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3391, \"fields\": {\"question\": 365, \"description\": \"As President, I will reach out to key military leaders for their advice on this issue.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3392, \"fields\": {\"question\": 365, \"description\": \"To defend against whom? The Cold War is over and we should be working <em>with</em> Russia, not against them. This is just more unnecessary military spending.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3393, \"fields\": {\"question\": 366, \"description\": \"After eight years of scandals and excesses from the Clinton Administration, I will return this country to its rightful principles -- small government, clean moral conduct, and the freedom of the people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3394, \"fields\": {\"question\": 366, \"description\": \"I will ask the American people if they really want to vote for a third term of Bill Clinton, and remind them that I am the true conservative alternative. I will remind them of Al Gore's campaign finance violations and frequent misrepresentations to the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3395, \"fields\": {\"question\": 366, \"description\": \"Conservatism doesn't mean anger and divisiveness. I will govern as a sensible, pragmatic conservative and pass reforms that are broadly acceptable to the American people. I will return a part of our historic surplus to all of our hard-working families who pay taxes.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3396, \"fields\": {\"question\": 366, \"description\": \"As President, I will work with Republicans and Democrats to advocate for programs that all Americans can approve of. We need to move past the divisiveness of recent years and strengthen our economy, Social Security, education, and Medicare. I would prefer to return some of the budget surplus to the people, but I am willing to compromise to get things done.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3405, \"fields\": {\"question\": 369, \"description\": \"We will emphasize that a vote for Al Gore is a vote for the scandals and liberal policies of the Clinton Administration. We offer a true, conservative alternative to the American people. I will discuss my evangelical Christianity and small-government beliefs.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3406, \"fields\": {\"question\": 369, \"description\": \"It is important to nail down our conservative base by emphasizing tax cuts, my evangelical background, opposition to abortion, a strong defense, and limits to government spending. We will ignore Bill Clinton, but paint Al Gore as out of touch.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3407, \"fields\": {\"question\": 369, \"description\": \"We need to run an attacking campaign against Al Gore. We will expose his misstatements and emphasize that his proposals will squander our budget surplus and greatly increase the size and scope of government.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3408, \"fields\": {\"question\": 369, \"description\": \"I will campaign as a conciliatory, moderate conservative. I will emphasize my record as the Governor of Texas, and my support across different groups and parties. We will minimize any talk of budget cuts or overturning existing programs. We will resist the temptation to criticize Bill Clinton.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3482, \"fields\": {\"question\": 389, \"description\": \"I plead guilty. I don't have experience with the broken political culture of Washington, unlike my opponent. I will clean this system up when I am President.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3417, \"fields\": {\"question\": 372, \"description\": \"Let's give a good speech about how I am the mainstream, conservative candidate who will control spending and return our surplus to the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3418, \"fields\": {\"question\": 372, \"description\": \"Domestic issues. Let's talk about my plans to reform Social Security, education, and Medicare to ensure the future prosperity of America. Let's remind voters that these are common-sense proposals that appeal to almost everyone.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3419, \"fields\": {\"question\": 372, \"description\": \"We need to attack Al Gore's views on the environment, on energy, on taxes, on spending, and on the right direction for our country. He is out of touch with the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3420, \"fields\": {\"question\": 372, \"description\": \"I will emphasize my record and experience as Governor of Texas. I will remind voters that I have worked across the aisle, won support from many different groups, and will be a uniter, not a divider, when I arrive in Washington.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3425, \"fields\": {\"question\": 374, \"description\": \"Let's give a good speech about how I am the mainstream, conservative candidate who will control spending and return our surplus to the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3426, \"fields\": {\"question\": 374, \"description\": \"Domestic issues. Let's talk about my plans to reform Social Security, education, and Medicare to ensure the future prosperity of America. Let's remind voters that these are common-sense proposals that appeal to almost everyone.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3427, \"fields\": {\"question\": 374, \"description\": \"We need to attack Al Gore's views on the environment, on energy, on taxes, on spending, and on the right direction for our country. He is out of touch with the American people.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3428, \"fields\": {\"question\": 374, \"description\": \"I will emphasize my record and experience as Governor of Texas. I will remind voters that I have worked across the aisle, won support from many different groups, and will be a uniter, not a divider, when I arrive in Washington.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3453, \"fields\": {\"question\": 381, \"description\": \"I will spend the end of my campaign with my brother Jeb in Florida. This state will be critical to our chances.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3454, \"fields\": {\"question\": 381, \"description\": \"I will appear in Pennsylvania and spend the latter half of the day in Ohio. These are two huge states that we can bring into the fold.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3455, \"fields\": {\"question\": 381, \"description\": \"The upper Midwest is key. I will start in Iowa, travel through Wisconsin, and end up in Michigan.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3456, \"fields\": {\"question\": 381, \"description\": \"We need to focus on states like Missouri, Tennessee, and Arkansas. Clinton may have won them four years ago, but with one last push we can make them go Republican.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3464, \"fields\": {\"question\": 384, \"description\": \"This could destroy my campaign in the final days. We must accuse the Gore campaign of leaking this to discredit my candidacy, and challenge their credibility and timing.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3465, \"fields\": {\"question\": 384, \"description\": \"I will admit my guilt and apologize to the American people for hiding this story. I will say it was a mistake in judgment to believe that this would not come to light in our modern media environment.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3466, \"fields\": {\"question\": 384, \"description\": \"I will emphasize that I made mistakes in the past that I'm not proud of, and that I've always been up front with the American people about that fact. I will also remind the voters that I have not drank alcohol since 1986, and question why this came out five days before the election.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3467, \"fields\": {\"question\": 384, \"description\": \"I refuse to comment on this issue. My spokeswoman will remind the American people that the real issue is who will be a better President for the country.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3478, \"fields\": {\"question\": 388, \"description\": \"These stories are absolutely false. I never used illegal drugs and those who say I did are completely mistaken.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3479, \"fields\": {\"question\": 388, \"description\": \"I did some things when I was younger that I'm not proud of. But my record in office and my conduct over the past two decades is clear. I stopped drinking in 1986 and never looked back.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3480, \"fields\": {\"question\": 388, \"description\": \"These types of stories should be irrelevant to a political campaign. We've all done things when we were young that we're not proud of.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3481, \"fields\": {\"question\": 389, \"description\": \"This is nonsense. I have served as the Governor of Texas, the second largest state in the country, for nearly six years.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3483, \"fields\": {\"question\": 389, \"description\": \"James Buchanan had a lot of experience in government. Abraham Lincoln didn't. So what if I'm a little unseasoned? I have the instincts for the job.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3493, \"fields\": {\"question\": 393, \"description\": \"Dick Cheney is a principled conservative leader. The two of us will govern over a conservative, patriotic administration. Let's turn the page from the Clinton era.\"}}, {\"model\": \"campaign_trail.answer\", \"pk\": 3494, \"fields\": {\"question\": 393, \"description\": \"Dick Cheney is the best person for the job. He has served in all kinds of roles and performed admirably in every case.\"}}]");
